ï»¿import styled from 'styled-components'

export const Wrapper = styled.section`
  width: 1000px;
  margin-top: 60px;
  flex-direction: column;
  align-items: center;
  font-size: 1.5rem;
  justify-content: center;

  ul {
    list-style-type: none;

    li {
      display: flex;

    }
  }
`

export const Button = styled.button`
  width: 90px;
  height: 30px;
  background-color: #e0445b;
  color: #fff;
  font-size: 1.3rem;
  border: 0 solid;
  border-radius: 5px;
  align-items: center;
  margin: 15px;
`
